INSERT INTO `properties` VALUES ('5f16abc2d762456791d3bce4', '102 Brookstone PL', '102-brookstone-pl', 4, 3, 1694, 'Wei Zhou (Nick) Chen', 'Showing starts now. Offers as received. Welcome to this Spectacular Park & Lake view walkout Bungalow located on one of the most exclusive street on South Pointe. 12 feet ceiling and lots of windows bring in tons of natural light. Open concept kitchen with large curve island and alum & glass kitchen cabinets. Large living room with entertainment wall, tile facing fireplace. You will see the lake and reserve park greenspace once you step out of your main floor balcony. Master bedroom is privately located on one wing of home and has large spa-inspired ensuite that has jetted tub & frameless glass shower. Separate wing has 2nd bedroom and bath. Fully finished walkout basement features a large open rec room, custom wet bar. 2 additional bedrooms, one used for theater. Built on piles and engineered floor joists. Extra wide driveway and 22\'*32 garage. New shingle (2020) Book your showings today!!!', '202013112', '5f4781057c9f6d757331cdfa', '5f4781057c9f6d757331cdfa', '[\"5f16e464cf2c6d539d1c794a\",\"5f16b17f347f3c2011541399\",\"5f16b17f3c71901b8c589d07\",\"5f16b17f1694e51cf7ad3282\",\"5f16b17f363589bb5995438a\",\"5f16b17f84f199680bdcbf43\",\"5f16b17f79f98f24e00fe08a\",\"5f16b17e5d61ac5689b9a23f\",\"5f16b17e3c71907661589d05\",\"5f16b17e5e19a9bb5f6e0dbd\",\"5f16b17e9303e877e6b83e75\",\"5f16b17dcf7d114c57376f3c\",\"5f16b17d5d61ac7ee8b9a23e\",\"5f16b17d2444ee1f7c013044\",\"5f16b17df6b2e1c436fc22fe\",\"5f16b17c347f3c5d02541396\",\"5f16b17c6025bcc95613b279\",\"5f16b17caededa73969f692b\",\"5f16b17ccf7d11c7e4376f3b\",\"5f16b17ccf7d1141cc376f3a\",\"5f16b17c9a54e150947e91f0\",\"5f16b17dd0748454eca33321\",\"5f16b17c4d2842cab05c8437\",\"5f16b17c826361c5964eb3d7\",\"5f16b17c5d61ac6208b9a23d\"]', 729900.00, '5f28c07ec1a3c94a6ab30453', '5f28c3334e58bf6e4e9d43ba', '5f28c2f10943538634ee889e', '5f28c4b3245a285d0e2fd967', '5f16abb82444ee9518011d2a', '[