INSERT INTO `properties` VALUES ('5f187d61d6744add92ba358a', '1 Plan 65626 Parkside DR', '1-plan-65626-parkside-dr', 0, 0, 0, 'Rick Gensiorek', 'A great opportunity awaits to build a new country home at an absolutely great location just outside of Winnipeg!!     Newly subdivided property(ies) provides an opportunity to start country living on 6 acres of prime property, located just off Highway 59 and only a few minutes  drive to all amenities located in both the City of Winnipeg and the town of Birds Hill.     Country living awaits at a very affordable price for rural property, with the added advantage of being in very close proximity of the Birds Hill Provincial Park and only a short hour drive to the Whiteshell Provincial Park.   Dreams of living in the country can become reality!  Call today for an appointment to view', '202015397', '5f187d5f388b02d0d3073562', '5f187d5f388b02d0d3073562', '[\"5f187d5f388b02d0d3073562\"]', 144900.00, '5f28c22228f2fd31839e5f8a', '5f28c3453278064238d9d767', '5f28c2b6397ee38a604aa381', '5f28c4b3245a285d0e2fd967', '5f16abb82444ee9518011d2a', '[]');
