INSERT INTO `properties` VALUES ('5f187dc1c59b4b1b43b723f2', '3 865 Rathgar AVE', '3-865-rathgar-ave', 2, 3, 1300, 'Stacey Campbell', 'A wonderful residence nestled in the vibrant & perfectly located South Osborne. Wonderful home w/sought after features like main floor bath & laundry, Large windows to maximizes natural light! A/C, all brand new appliances, 2 min walk to large park, 2 min walk to rapid transit station!  ** PET FRIENDLY - NO SIZE RESTRICTIONS!Private patio off the second floor to enjoy afternoons in the sun or evening breezes. Great kitchen w/quartz countertops & SS appliances. Eat up kitchen island & formal dining area! Brand New!Master bed room is a DREAM- spoil yourself - oversize WALK IN closet and LARGE en-suite with his and hers sinks and large shower. Walk through the open concept den to your private balcony for your morning coffee!! Guest bed room - good size with large window, adjacent the second floor full bath. Elegant home with huge windows! 1300sq ft of living space, covered 2 car parking, patio off the front door. The best in location! Lord Roberts Rapid Transit popular subdivision!', '202011341', '5f187db6060f3090c107120e', '5f187db6060f3090c107120e', '[\"5f187db6060f3090c107120e\",\"5f187db62f90a05007bd9e85\",\"5f187db63377070c5d0bb4ed\",\"5f187db66d170c650ee4783a\",\"5f187db66482c4fd2c969f0f\",\"5f187db636231e0cee854685\",\"5f187db6fc337a692a0028c0\",\"5f187db723901f04b422d0a4\",\"5f187db72d790d79eabfac72\",\"5f187db7fc337ae3c00028c3\",\"5f187db66f8aae379a0aa5ef\",\"5f187db623901f1d8322d0a3\",\"5f187db6213e3d79360e2e04\"]', 329980.00, '5f28c07ec1a3c94a6ab30453', '5f28c36de051c60c8c863e93', '5f28c2c0a98f21369d78de56', '5f28c4b3245a285d0e2fd967', '5f16abb82444ee9518011d2a', '[]');
INSERT INTO `properties` VALUES ('5f187f0817f39e24d4e47d2b', '4 Bartman DR', '4-bartman-dr', 1, 2, 1002, 'Wesley Dowse', 'OTP as presented.  This home is a combination of modern design elements, quality constructiondelivered in an affordable price range! Almost a total of 2000 sq/ft. of living space when including basement square footage once completed. The main floor\'s open concept floor plan is great for entertaining whichincludes large windows and 9\' ceiling height giving the home a bright & spacious feel. The kitchen is at theheart of this home perfect for those who love to cook & entertain providing plenty of storage space, largeisland w/ seating area & huge pantry. The floor plan has a front dining area & rear living room w/ gardendoor opening onto the future back deck. The main floor includes 1 Master bedrooms & 1.5 baths, thespacious master bedroom is equipped w/ an elegantly designed ensuite w/ shower, glass door & walk incloset. Additional features include: dbl att. garage, Piled foundation, ICF basement, Engineered floor joists,5yr. New Home warranty, Net GST & much more', '202015975', '5f187f0318c17438393723e6', '5f187f0318c17438393723e6', '[\"5f187f0318c17438393723e6\"]', 339900.00, '5f28c21ce10a062276e737c8', '5f28c33f21daad0b4e56a200', '5f28c2c0a98f21369d78de56', '5f28c4b3245a285d0e2fd967', '5f16abb82444ee9518011d2a', '[]');
INSERT INTO `properties` VALUES ('5f187f1975f52aee8db1c51d', '4 Spillway COVE', '4-spillway-cove', 0, 0, 0, 'Michelle Hartin', 'Build your dream home here on 0.55 Acre Lot located in the friendly community of St Malo. Country Living minutes away from Provincial Park, beach, swimming, camping, snowmobiling, fishing, canoeing and kayaking. What a great opportunity to raise your family or to retire. This property is serviced with Water, Hydro, Telephone, Culvert and Approach. Please call listing agent for more information.', '202011452', '5f187f14514a5c7422ed8baa', '5f187f14514a5c7422ed8baa', '[\"5f187f14514a5c7422ed8baa\",\"5f187f14514a5c62dded8bab\",\"5f187f14ba1c1aebaa426652\",\"5f187f14377d2912f58189a1\"]', 39900.00, '5f28c2261db8386bb625675c', '5f28c3453278064238d9d767', '5f28c2b6397ee38a604aa381', '5f28c4b3245a285d0e2fd967', '5f16abb82444ee9518011d2a', '[]');
