INSERT INTO `properties` VALUES ('5f188361df8ddda07978cce8', '21 Chimney Swift WAY', '21-chimney-swift-way', 3, 3, 1816, 'Wesley Dowse', 'Offers as received, Custom designed to be built by Reve Custom Homes in St. Adolphe\'s Tourond Creek Development. This home\'s impeccable design will only be surpassed by the quality of the build. Designed to maximize it\'s space this home will feel larger than it\'s 1816sf suggests it should. The main floor features an open concept floor plan w/ living opening into dining & kitchen areas, perfect for the growing family or those who love to entertain. Kitchen features shaker style doors, laminate counter tops, large island w/ seating area & huge pantry, garden door off the kitchen opens onto your future back deck. Main floor includes 2pc. bath & mudroom /laundry opening into dbl. attached garage as well as front office /bedroom. The 2nd floor include 3 generous sized bedrooms & 2 full baths. The master bedroom is spacious & equipped w/ ensuite w/ soaker tub, shower & walk-in closet. Built on an ICF basement, includes 5yr warranty & Net GST, large lot, NO back yard neighbours!', '202015978', '5f18834637268c1729d1feef', '5f18834637268c1729d1feef', '[\"5f18834637268c1729d1feef\",\"5f188346060f3061ea072614\"]', 469900.00, '5f28c21ce10a062276e737c8', '5f28c36de051c60c8c863e93', '5f28c2e0024da61ac66ebcb6', '5f28c4b3245a285d0e2fd967', '5f16abb82444ee9518011d2a', '[]');
