INSERT INTO `properties` VALUES ('5f1883cc685c7080fc488e7e', '24 Evergreen RD', '24-evergreen-rd', 3, 2, 1468, 'Rick Gensiorek', 'This absolutely gorgeous 4-season cottage allows a person to blend a recreational lifestyle with at-home luxury. Nestled amongst the evergreens in the Sand Cliff Estates, you can access the public beach with a 5 minute walk on one of the various trails that extend from the front door. Built in 2010, this cottage underwent a considerable makeover in 2019 and now prides itself with new paint, flooring, kitchen, and much more. The large .34 acre property has a fenced in backyard and an oversized 24x24 double attached garage. This cottage has too much to mention but a few highlights include: 200 amp service; baseboard heating with a WETT approved wood burning appliance; new vinyl siding and aluminum soffits, fascia and eaves troughs; low E argon dual pane windows; garden doors leading to an enormous front deck (cottage also has a large back deck); walk-in closet off MBR; 4 foot crawl space fully insulated and vapor barrier; 110 foot deep well; marble tile flooring in main bath; etc.This is a MUST SEE cottage!', '202006277', '5f1883b3c2241c0a0f3ed768', '5f1883b3c2241c0a0f3ed768', '[\"5f1883b3c2241c0a0f3ed768\",\"5f1883b340e0ea539ef124fb\",\"5f1883b218c174a395372c9c\",\"5f1883b267df614db6f13d19\",\"5f1883b2eb577d8088259843\",\"5f1883b2c1b99c07127b14f7\",\"5f1883b259d2f3d9301a9e78\",\"5f1883b2388b021e290748ba\",\"5f1883b26f8aaee12c0ab691\",\"5f1883b21d62322964e57b80\",\"5f1883b4d56fe92c6d27242d\",\"5f1883b4388b0223dc0748bb\",\"5f1883b3060f303a910729f6\",\"5f1883b3c1b99cc6d97b14f8\",\"5f1883b3df353e57bc307ec5\",\"5f1883b3fc337a7acf003730\",\"5f1883b326a30b051b51d005\",\"5f1883b38ee92a8d3e442e13\"]', 279900.00, '5f28c8394db7cb8577b70bfc', '5f28c3334e58bf6e4e9d43ba', '5f28c2c0a98f21369d78de56', '5f28c4b3245a285d0e2fd967', '5f16abb82444ee9518011d2a', '[]');
