INSERT INTO `properties` VALUES ('5f188579a9034b73845f1e06', '46 Amanda LANE', '46-amanda-lane', 3, 2, 1447, 'Wesley Dowse', 'Offers as presented, currently under construction. This is your opportunity to escape the city into this Modern Country themed build.  Located in the Kokomo area just North-West of La Broquerie on a maturely treed 2 acre lot. The exterior will be an attractive low maintenance combination of stucco, siding and board & batten with a front porch contributing to the country feel.  The interior features include an amazing open concept floor plan with 9\' ceilings and feature wall w/ electric fireplace. The kitchen features a huge 9\' island w/ seating area, ample cupboard & counter space opening into the dining & living room areas. The sliding door off the dining room opens onto the 16\' X 15\' Covered future deck. This home includes 3 generous sized bedrooms & 2 full baths. The master includes a 3pc ensuite & dual closets. This home is built on a ICF crawl space, includes electric forced air heat, septic tank & field and private well.  Purchase price includes Lot & Net GST. Call now for details!', '202014971', '5f18857226346cc098c8d44d', '5f18857226346cc098c8d44d', '[\"5f18857226346cc098c8d44d\",\"5f18857263186b9cbbbd2045\"]', 329900.00, '5f28c1d6ce2bd9f6c03a60d2', '5f28c3334e58bf6e4e9d43ba', '5f28c2c0a98f21369d78de56', '5f28c4b3245a285d0e2fd967', '5f16abb82444ee9518011d2a', '[]');
