INSERT INTO `properties` VALUES ('5f188ccdc981bc6bcf1daf4e', '1143 Henderson HWY', '1143-henderson-hwy', 0, 0, 0, 'Rick Gensiorek', 'IDEAL BUSINESS LOCATION!!  Large 2-story building ideally situated on a commercial strip alongside - and across from - other businesses, some of which are franchised.  Being a more notably sized building in that vicinity, it benefits from high business traffic and can offer strong business potential.   The property has ample parking out front as well as parking behind the building and along side residential street.  Building is situated across from another commercial strip which holds considerable scramble parking.   Both commercial strips are linked by a cross walk which accommodates pedestrian traffic amongst businesses on both sides of Henderson.   A high concentration of residential homes surrounds the subject property which also contributes to the high traffic flow on Henderson (ideal for a business). Bus stop exists near property, providing easy access for clientele without vehicles.   Current owners may be willing to lease for a term if that would accommodate start-up period for a new business.', '202015870', '5f188ccbaebb5956016612da', '5f188ccbaebb5956016612da', '[\"5f188ccbaebb5956016612da\"]', 1189000.00, '5f28c07ec1a3c94a6ab30453', '5f28c44bf4e9782db472febb', '5f28c306b7311748f18a763a', '5f28c4b3245a285d0e2fd967', '5f16abb82444ee9518011d2a', '[]');
