INSERT INTO `properties` VALUES ('5f477379818f5b07d4a0c7de', '301 110 Creek Bend RD', '301-110-creek-bend-rd', 1, 2, 1088, 'Russel Kehler', 'TRULY A WOW CONDO: Excellence and elegance is evident when you first walk in to this well appointed 1088 sq ft condo. Only one of 5 of these units in this building which features the full glass curved living room wall. Loaded with many thousands of dollars of upgrades that include marble finish walls in living, dining and kitchen. Other upgrades include LED lighting, dble pantries in the kitchen, marble backed island + front of island, marble back splash, executive custom blinds + newer appliances with full 4 and 5 year warranties. The ensuite/walk in closet is stunning with marble accents. Walk in closet was upgraded with additional shelving and cabinetry. Sit on your private deck + enjoy the scenery of the Seine River. Unit is located at the end of a quieter traffic area. Building has been sound proofed with hollow core floors + ICF concrete ext walls add to the noise free enjoyment of the suite. Parking includes one underground heated spot and another one outside. 2 storage units included as well.', '202020686', '5f4787d53b12fc38795b402c', '5f4787d53b12fc83305b402b', '[\"5f4787d53b12fc87045b402a\",\"5f4787d53b12fc2dd55b402f\",\"5f4787d53b12fc036a5b402d\",\"5f4787d53b12fca9b85b402e\",\"5f4787d53b12fcf7fa5b4030\",\"5f4787d53b12fcca1e5b4033\",\"5f4787d53b12fc46055b4036\",\"5f4787d53b12fc79015b4034\",\"5f4787d53b12fca64e5b4032\",\"5f4787d53b12fc320a5b4031\",\"5f4787d53b12fc8edb5b4038\",\"5f4787d53b12fc82c05b4035\",\"5f4787d53b12fcaae75b4037\",\"5f4787d53b12fc5c065b4039\",\"5f4787d53b12fc10625b403a\",\"5f4787d53b12fc04a25b403c\",\"5f4787d53b12fc81205b403b\",\"5f4787d53b12fc2dd55b402f\"]', 367500.00, '5f28c07ec1a3c94a6ab30453', '5f28c3f203d9202264238038', '5f28c2d520520b83b7b32f23', '5f28c4b3245a285d0e2fd967', '5f16abb82444ee9518011d2a', '[]');
