INSERT INTO `properties` VALUES ('5f4773a2fbd30c4b9af8da78', '83 Scammel RD', '83-scammel-rd', 3, 3, 1845, 'Andrew St. Hilaire', 'Showings start now. Offers Aug 31. Beautiful 1845 SF 3 bedroom 3 bath two-storey in River Park South. Open concept living room and kitchen, tons of natural light, porcelain tiles with in-floor heat throughout main floor and upstairs baths, solid hardwoods stairs & 2nd floor. Flush mount registers throughout with no transitions anywhere. Large master and spacious 2nd and 3rd bedrooms with walk-in closets. Granite counters in kitchen & baths. All appliances included. Alarm, piled foundation, central air conditioning, insulated garage and door, 9-foot basement height, Delta Wrap foundation, Tuxedo Connected Controller system for heat, lights & alarm, unfinished insulated basement with roughed in plumbing ready for your design. Large fenced backyard, custom design and many builder upgrades. Close to schools, St Vital Shopping Centre, parks, paths and trails.', '202021450', '5f47880188fe4adc0637f1f9', '5f47880188fe4adc0637f1f9', '[\"5f47880188fe4adc0637f1f9\",\"5f47880188fe4a1d2237f1fc\",\"5f47880188fe4a478737f1fa\",\"5f47880188fe4aac7437f206\",\"5f47880188fe4ad20737f1fb\",\"5f47880188fe4a53a237f208\",\"5f47880188fe4a654a37f209\",\"5f47880188fe4a3e2b37f207\",\"5f47880188fe4ae1bf37f20a\",\"5f47880188fe4a5dea37f20b\",\"5f47880188fe4a54a337f20c\",\"5f47880188fe4ae32f37f212\",\"5f47880188fe4af1de37f211\",\"5f47880188fe4ac34237f213\",\"5f47880188fe4a275a37f20e\",\"5f47880188fe4a585037f20f\",\"5f47880188fe4ae0e737f210\",\"5f47880188fe4ae50537f20d\",\"5f47880188fe4a652637f217\",\"5f47880188fe4a5dd937f21a\",\"5f47880188fe4a905037f215\",\"5f47880188fe4a442237f214\",\"5f47880188fe4a883837f216\",\"5f47880188fe4a526237f219\",\"5f47880188fe4a589b37f218\"]', 520000.00, '5f28c07ec1a3c94a6ab30453', '5f28c36de051c60c8c863e93', '5f28c2e0024da61ac66ebcb6', '5f28c4b3245a285d0e2fd967', '5f16abb82444ee9518011d2a', '[\"5f47d06002ac038685e22cd2\",\"5f47d06002ac0390a6